// code for subroutines (not shown)
void powerupCollected(int i){
	if (powerUp[i].id==1){
		delete_paddle();
		if ((paddle.x-20)<0)
			paddle.x=0;
		if ((paddle.x+(paddle.width+20)>320))
			paddle.x=320-(paddle.width+40);
		
		paddle.width+=40;
		draw_paddle(0xFFFF);
		
	}else if (powerUp[i].id==2){
		delete_paddle();
		paddle.width-=40;
		draw_paddle(0xFFFF);
		
	}else if(powerUp[i].id==3){
		lasersLeft+=numLasers;
	}
}

void draw_laser(int x, int y){
	for (int i=0;i<18;i++){
		plot_pixel( x, y+i,65251);
	}
	for (int i=0;i<13;i++){
		plot_pixel( x-1, y+i+2,65251);
		plot_pixel( x+1, y+i+2,65251);
	}
}
void delete_laser(int x, int y){
	
	for (int i=0;i<18;i++){
		plot_pixel( x, y+i,background[x][y+i]);
	}
	for (int i=0;i<13;i++){
	plot_pixel( x-1, y+i+2,background[x-1][y+i+2]);
		plot_pixel( x+1, y+i+2,background[x+1][y+i+2]);
	}

}


void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;
        
        one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
        
        *one_pixel_address = line_color;
}
void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = 0xFF203020;
    register int status;
	
    *pixel_ctrl_ptr = 1; //start the synchronization process
    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0)
    {
        status = *(pixel_ctrl_ptr + 3);
    }
}

