void draw_paddle(short int colour){
	int temp=20,temp2=2,temp3=0;;
	for (int i=0; i<paddle.width-temp;i++){
				for (int j=0; j<paddle.length;j++){
					plot_pixel(paddle.x+(temp/2)+i,paddle.y+j,colour);
				}
			}
	for (int i=0; i<temp/2;i++){
				for (int j=0; j<temp2;j++){
					plot_pixel(paddle.x+i,(paddle.y+(paddle.length/2)-(temp2/2)+j),colour);
					plot_pixel((paddle.x+paddle.width)-i-1,(paddle.y+(paddle.length/2)-(temp2/2)+j),colour);
				}
		temp3++;
			if (temp2!=10&&temp3==2){
				temp2+=2;
				temp3=0;
			}
		}
	
}
	
