void draw_brick(int x, int y, short int colour, short int borderColour){
for (int i=1; i<BRICK_WIDTH;i++){
				for (int j=1; j<BRICK_LENGTH;j++){
					plot_pixel(x+i,y+j,colour);
					backgroundBricks[x+i][y+j]=colour;
				}
			}
	
	draw_line(x,y,x,y+BRICK_LENGTH,borderColour);
	draw_line(x,y,x+BRICK_WIDTH,y,borderColour);
	draw_line(x,y+BRICK_LENGTH,x+BRICK_WIDTH,y+BRICK_LENGTH,borderColour);
	draw_line(x+BRICK_WIDTH,y,x+BRICK_WIDTH,y+BRICK_LENGTH,borderColour);
}
void draw_line(int x, int y, int x2, int y2, int colour){
	int temp=0, yin;
	bool is_steep = abs(y2-y)>abs(x2-x);
	if (is_steep){
		temp=x;
		x=y;
		y=temp;
		temp=x2;
		x2=y2;
		y2=temp;
	}
	if (x>x2){
		temp=x;
		x=x2;
		x2=temp;
		temp=y;
		y=y2;
		y2=temp;
	}
	int y_step,dx,dy,error;
	dx=x2-x;
	dy=abs(y2-y);
	error = -(dx/2);
	yin=y;
	if (y<y2) y_step=1;
	else y_step=-1;
	
	for(int i=x;i<=x2;i++){
		if (is_steep) {plot_pixel(yin,i,colour);
					  backgroundBricks[yin][i]=colour;}
		else {plot_pixel(i,yin,colour);
			 backgroundBricks[i][yin]=colour;}

		error=error+dy;
		if(error>0){
			yin=yin+y_step;
			error=error-dx;
		}
	}
}
