void paddleShift(){
	//This is where we check for user input----------------------------------
	int PS2_data, RVALID;
	PS2_data = *(PS2_ptr);// read the Data register in the PS/2 port
		if(PS2_data!=0&&PS2_data!=0x6b&&PS2_data!=0x74){
			PS2_data = *(PS2_ptr);
			if (PS2_data==0x6b){
				//printf("left arrow\n");
				delete_paddle();
				if(paddle.x-30>0)
					paddle.x-=30;
				else
					paddle.x=0;	
				
				draw_paddle(0xffff);
			}
			if (PS2_data==0x74){
				//printf("right arrow\n");
				delete_paddle();
				if((paddle.x+paddle.width)+30<=320)
					paddle.x+=30;
				else
					paddle.x=(319-paddle.width);	
				
				draw_paddle(0xffff);
			}

		}	
}
void paddleShiftbad(){
// Defined flag variables to track key states

	PS2_data, RVALID; 
	byte1 = 0, byte2 = 0, byte3 = 0;
	*(PS2_ptr) = 0xFF;
	for(int jok=0;jok<5;jok++) { 
		PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port 
		RVALID = PS2_data & 0x8000; // extract the RVALID field 
		if (RVALID) { /* shift the next data byte into the display */ 
			byte1 = byte2; 
			byte2 = byte3; 
			byte3 = PS2_data & 0xFF; 
		}
		if(byte3==116){//byte1==116&&byte2==224&&byte3==240){
			//printf("right arrow\n");
			delete_paddle();
			if((paddle.x+paddle.width)+paddleshiftAmount<=320)
				paddle.x+=paddleshiftAmount;
			else
				paddle.x=(319-paddle.width);	

			draw_paddle(0xffff);
			break;
		}else if(byte3==107){
			delete_paddle();
			if(paddle.x-paddleshiftAmount>0)
				paddle.x-=paddleshiftAmount;
			else
				paddle.x=0;	

			draw_paddle(0xffff);
			break;
		}else if(byte3==117){
			printf("up-");
		}
		byte1 = 0, byte2 = 0, byte3 = 0;
	} 	
	


  	
}
