void draw_word(int word[5][5], int color, int lcx, int lcy, int scale){
	for (int i = 0; i < 5; i ++){
		for (int j = 0; j < 5; j ++){
			if (word[i][j]==1){
				plot_pixel(lcy + (scale * j),lcx + (scale * i),color);
			}
		}
	}
}

int (*pick_number(int number))[5][5];

void display_score(int num, int start_x){
	int x_display = start_x+60;
	int num_size = 0;//,first,second,third,fourth,fifth;
	while(num > 0) {
		int display_num = num %10;
		num = num / 10;
		draw_word(n_full, BLUE, 4, x_display, 2);
		draw_word(*pick_number(display_num), 0xFFF, 4, x_display, 2);
		x_display-= 12;
		num_size++;
	}
	while(num_size < 5) {
		draw_word(n_full, BLUE, 4, x_display, 2);
		draw_word(n_0, 0xFFF, 4, x_display, 2);
		x_display-= 12;
		num_size++;
	}
//	for(int digits=0;digits<5;digits++){
	
//	}
}

int (*pick_number(int number))[5][5] {
    if (number == 0) {
        return &n_0; // Return pointer to n_0 array
    } else if (number == 1) {
        return &n_1;
    } else if (number == 2) {
        return &n_2;
    } else if (number == 3) {
        return &n_3;
    } else if (number == 4) {
        return &n_4;
    } else if (number == 5) {
        return &n_5;
    } else if (number == 6) {
        return &n_6;
    } else if (number == 7) {
        return &n_7;
    } else if (number == 8) {
        return &n_8;
    } else {
        return &n_9;
    }

}
void brickActivate(int i, int j){
			bricks1[i][j].colour=colour[j+4];
			bricks1[i][j].borderColour=444;
			bricks1[i][j].x=9+(BRICK_WIDTH*i);
			bricks1[i][j].y=55+(BRICK_LENGTH*j);
			bricks1[i][j].broken=false;
			bricks1[i][j].toughness=0;
}
void goldbrickActivate(int i, int j){
			bricks1[i][j].colour=GOLDBRICK;
			bricks1[i][j].borderColour=444;
			bricks1[i][j].x=9+(BRICK_WIDTH*i);
			bricks1[i][j].y=55+(BRICK_LENGTH*j);
			bricks1[i][j].broken=false;
				bricks1[i][j].toughness=1;
}
void brickActivateC(int i, int j, short int col){
			bricks1[i][j].colour=col;
			bricks1[i][j].borderColour=col;
			bricks1[i][j].x=9+(BRICK_WIDTH*i);
			bricks1[i][j].y=55+(BRICK_LENGTH*j);
			bricks1[i][j].broken=false;
			bricks1[i][j].toughness=0;
}

